import React from 'react';

function Education() {
  return (
    <div className="education">
      <h1>Education</h1>
      <div className="educationitem">
        <h3><strong>Ajou University (아주대학교) | 2020.03 - 2024.03</strong></h3>
        <ul>
            <li><strong>Early Graduation (조기 졸업)</strong></li>
            <li><strong>GPA | 4.20 / 4.50 </strong></li>
        </ul>
      </div>
    </div>
  );
}

export default Education;
